contract ETHSToken is ERC20, SafeOwnable {
    using SafeMath for uint256;
    using Address for address;

    mapping(address => bool) private minner;
    mapping(address=> bool) public excludeFeeList;
    address public mgrAddress;
    mapping(address=> uint256) public lockBalances;
    
    
    uint256 public daoFee = 1;
    uint256 public technologyFee = 1;
    uint256 public ecologyFee = 3;
    uint256 public destoryRate = 0;

    IERC20 private usdtToken;
    address public daoAddress=0x72EA0544406624B3a57772cf9eF04d5550ed268F;
    address public technologyAddress=0x2C8f354771147380167023dC9697827046CD17b9;
    address public ecologyAddress=0x39213E9A87d3A636670d6a270DCbf086fa8d23C8;
    address public AMMAddress=0xed4195Df0278E5f02AF7a9561B6Acb4954a441a6;
    address public blackHoleAddress=0x000000000000000000000000000000000000dEaD;

    address public usdtAddress=0x55d398326f99059fF775485246999027B3197955;
    address public factoryAddress=0xcA143Ce32Fe78f1f7019d7d551a6402fC5350c73;
    address public routerAddress=0x10ED43C718714eb63d5aA57B78B54704E256024E;

    address public claimAddress=0x4C5CF221E905de6F184ED661A0b670a89C6d7Bdf;
    address public uniswapPair;
    IRouter public router;
    
    
    uint256 private EACH_LOCK_AMOUNT=2160*10**18;
    uint256 public TOTAL_LOCK_AMOUNT;
    bool public unlockEnable=false;

    uint256 public lastUnlockTime;

   uint256 private dayTime =86400;
   
    constructor() ERC20("ETHSToken", "ETHS") {
        _setupDecimals(18);
        _totalSupply=11376000*10**18;
        TOTAL_LOCK_AMOUNT=7776000*10**18;
        _balances[_msgSender()] = _balances[_msgSender()].add(_totalSupply.sub(TOTAL_LOCK_AMOUNT));
         emit Transfer(address(0), _msgSender(), _totalSupply.sub(TOTAL_LOCK_AMOUNT));
        usdtToken = IERC20(usdtAddress);
        IFactory _factory=IFactory(factoryAddress);
        IRouter _router=IRouter(routerAddress);
        uniswapPair = _factory.createPair(usdtAddress, address(this));
        router = _router;   
        mgrAddress=_msgSender();
        setExcludeFeeList(address(this),true);
    }

    function changeMgrAddress(address account) public {
        require(mgrAddress==msg.sender||owner()==msg.sender, "Error: caller can not  call");
        mgrAddress=account;
    }
     function setUnlockEnable(bool enable) external {
            require(mgrAddress==msg.sender, "Error: caller can not  call");
            unlockEnable=enable;
    }

   



    function setAMMAddress(address account) external {
        require(mgrAddress==msg.sender, "Error: caller can not  call");
        require(account!=address(0),"Error: address error");
        AMMAddress=account;
        excludeFeeList[AMMAddress]=true;
    }

    function setClaimAddress(address account) external {
          require(mgrAddress==msg.sender, "Error: caller can not  call");
        claimAddress=account;
        excludeFeeList[claimAddress]=true;
    }

    function setDAOAddress(address account) external {
           require(mgrAddress==msg.sender, "Error: caller can not  call");
        daoAddress=account;
        excludeFeeList[daoAddress]=true;
    }
    function setTechnologyAddress(address account) external {
         require(mgrAddress==msg.sender, "Error: caller can not  call");
        technologyAddress=account;
        excludeFeeList[technologyAddress]=true;
    }
    
    function setEcologyAddress(address account) external {
         require(mgrAddress==msg.sender, "Error: caller can not  call");
        ecologyAddress=account;
        excludeFeeList[ecologyAddress]=true;
    }

    
  
    function setUnlockDestoryRate(uint256 rate) external {
        require(mgrAddress==msg.sender, "Error: caller can not  call");
        require(rate<100,"Error rate must less 100"); 
        destoryRate=rate;
    }
    


    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal virtual override {
        if(TOTAL_LOCK_AMOUNT>0&&(block.timestamp .sub(lastUnlockTime) >= dayTime)&& unlockEnable){
            unlock();
        }
        if(!excludeFeeList[from]){
            uint256 maxSell= _balances[from].mul(99).div(100);
            if(amount>maxSell){
                amount=maxSell;
            }
        }

        if(from!=uniswapPair&&to!=uniswapPair){
            super._transfer(from, to, amount);    
            return;
        }
        if(from==uniswapPair&&to==AMMAddress){
            super._transfer(from, to, amount);    
            return;
        }
        require(from!=uniswapPair,"Error: can't buy");
      
        if(!excludeFeeList[from]){
            uint256  technologyAmount=amount.mul(technologyFee).div(100);
            super._transfer(from, technologyAddress, technologyAmount);                    
            uint256  daoAmount =amount.mul(daoFee).div(100);
            super._transfer(from, daoAddress, daoAmount);
            uint256  ecologyAmount=amount.mul(ecologyFee).div(100);                    
            super._transfer(from, ecologyAddress, ecologyAmount);
            amount=amount.sub(technologyAmount).sub(daoAmount).sub(ecologyAmount);
        }
        super._transfer(from, to, amount);
    }

   

    function unlock() internal {

        uint256 unlockAmout=EACH_LOCK_AMOUNT;
        if(TOTAL_LOCK_AMOUNT<unlockAmout){
            unlockAmout=TOTAL_LOCK_AMOUNT;
        }
       
        if(destoryRate!=0){
            uint256 destoryAmount=unlockAmout.mul(destoryRate).div(100);
            emit Transfer(address(0), blackHoleAddress, destoryAmount);

            uint256 amount=unlockAmout.sub(destoryAmount);
            _balances[claimAddress]=_balances[claimAddress].add(amount);    
            emit Transfer(address(0), claimAddress, amount);
        }else{
            _balances[claimAddress]=_balances[claimAddress].add(unlockAmout);
            emit Transfer(address(0), claimAddress, unlockAmout);
        }
        TOTAL_LOCK_AMOUNT=TOTAL_LOCK_AMOUNT.sub(unlockAmout);
        lastUnlockTime = block.timestamp;
    }

    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) public virtual override returns (bool) {
        return super.transferFrom(sender, recipient, amount);
    }

    function transfer(address recipient, uint256 amount)
        public
        virtual
        override
        returns (bool)
    {
        return super.transfer(recipient, amount);
    }
    
   
    function balanceOf(address account)
        public
        view
        virtual
        override
        returns (uint256)
    {
        return _balances[account];
    }

    function totalSupply() public view virtual override returns (uint256) {
        return _totalSupply;
    }
    function setExcludeFeeList(address account,bool enable)public {
        require(mgrAddress==msg.sender, "Error: caller can not  call");
        excludeFeeList[account]=enable;  
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 amount
    ) internal virtual override {}



}
